import React from 'react';


import './Home.css'; // Add a separate CSS file for Home styling

const Home = () => (
  <div className="home-container">
    <h1>Welcome to the Student Empowerment Portal</h1>
    <p>Your one-stop solution for academic and personal growth resources!</p>
    <div className="card-container">
      {/* Card 1 */}
      <div className="card">
        <h2>GATE Classes</h2>
        <p>Prepare for GATE with expert-guided tutorials and resources.</p>
      </div>
      {/* Card 2 */}
      <div className="card">
        <h2>IIT Classes</h2>
        <p>Excel in IIT entrance exams with tailored classes and materials.</p>
      </div>
      {/* Card 3 */}
      <div className="card">
        <h2>CAT Classes</h2>
        <p>Master CAT preparation with top-notch strategies and guidance.</p>
      </div>
    </div>
  </div>
);

export default Home;
